import React, { useState } from 'react';
import './fileup.css';
import { useNavigate } from 'react-router-dom';
import FileUpload from './upload';
import logo from './Saint-Gobain_SEFPRO_logo_2023.png';

function FileDashBoard() {
    const [showDialog, setShowDialog] = useState(false);
    const navigate = useNavigate();
    const navigateToUser = () => {
      navigate('/users');
    };
    const navigateToCustomer = () => {
      navigate('/customers');
    };
    const openDialog = () => {
        setShowDialog(true);
      };
  const closeDialog = () => {
    setShowDialog(false);
  };

  return (
    <div className="Container">
      <div className="Header" style={{ display: 'flex' }}>
        <div className="logo">
          <img src={logo} alt="logo" style={{ width: '170px', height: '100px' }} />
        </div>
        <div className="pages">
          <p className='headerText'>Home</p>
        </div>
        <div className="pages">
          <p className='headerText'>New Plan</p>
        </div>
        <div className="pages">
          <p className='headerText'>Track Progress</p>
        </div>
        <div className="pages">
          <p className='home' style={{ color: '#00C7C8' }}>FileUpload</p>
        </div>
        <div className="pages">
          <p className='headerText' onClick ={navigateToUser}>Users</p>
        </div>
        <div className="pages">
          <p className='headerText' onClick ={navigateToCustomer}>Customers</p>
        </div>
        <div >
            <button className="logout" style={{ marginRight: '1%' }} onClick={() => setShowDialog(true)}>
          Logout</button>
        </div>
      </div>
      {showDialog && (
      <div className="dialog">
        <label className='confirmLogout'>Confirm Logout</label>
        <div className='buttons'>
        <button onClick={openDialog}>YES</button>
        <button className='yesbtn' onClick={closeDialog}>NO</button>
        </div>
      </div>
    )}
      <div className="fileupload">
          <FileUpload />
      </div>
      
    </div> 
  );
}

export default FileDashBoard;
